import React, { useState, useEffect } from "react";
import "../style/Collaboration.css"; // Scoped styles for this page

export default function CollaborativeReleases() {
  const [collaborations, setCollaborations] = useState([]);
  const [searchQuery, setSearchQuery] = useState("");
  const [minArtists, setMinArtists] = useState(2);
  const [error, setError] = useState("");
  const [sortConfig, setSortConfig] = useState({ key: "release_title", direction: "asc" });

  // Fetch data from API
  useEffect(() => {
    const fetchCollaborations = async () => {
      try {
        const response = await fetch("http://localhost:8080/releases-with-multiple-authors");
        if (!response.ok) {
          throw new Error(`Failed to fetch collaborations: ${response.status}`);
        }
        const data = await response.json();
        setCollaborations(data.rows || []); // Use data.rows if API returns a nested structure
        setError(""); // Clear any previous errors
      } catch (error) {
        console.error("Error fetching collaborations:", error);
        setError("Failed to load collaborations. Please try again later.");
      }
    };

    fetchCollaborations();
  }, []);

  // Sort and filter data
  const sortedCollaborations = [...collaborations].sort((a, b) => {
    if (!a[sortConfig.key] || !b[sortConfig.key]) return 0;
    if (sortConfig.direction === "asc") {
      return a[sortConfig.key] > b[sortConfig.key] ? 1 : -1;
    } else {
      return a[sortConfig.key] < b[sortConfig.key] ? 1 : -1;
    }
  });

  const filteredCollaborations = sortedCollaborations.filter(
    (collab) =>
      collab.artist_count >= minArtists &&
      (collab.release_title?.toLowerCase().includes(searchQuery.toLowerCase()) ||
        collab.artist_names?.toLowerCase().includes(searchQuery.toLowerCase()))
  );

  // Handle sort header click
  const handleSort = (key) => {
    setSortConfig((prevState) => ({
      key,
      direction: prevState.key === key && prevState.direction === "asc" ? "desc" : "asc",
    }));
  };

  return (
    <>
      {/* Navigation Bar */}
      <div id="navbar">
        <ul>
          <li><a href="http://localhost:3000/">HomePage</a></li>
          <li><a href="http://localhost:3000/search">Search Page</a></li>
          <li><a href="http://localhost:3000/genre">Genre Page</a></li>
          <li><a href="http://localhost:3000/collaboration">Collaboration</a></li>
        </ul>
      </div>

      <div id="collaborative-releases-page">
        <header>
          <h1>Collaborative Music</h1>
          <p>Explore releases featuring multiple artists and their collaborations.</p>
        </header>

        {/* Filters Section */}
        <div id="filters">
          <input
            type="text"
            placeholder="Search by title or artist"
            value={searchQuery}
            onChange={(e) => setSearchQuery(e.target.value)}
          />
          <input
            type="number"
            min="2"
            placeholder="Minimum Artists"
            value={minArtists}
            onChange={(e) => setMinArtists(Number(e.target.value))}
          />
        </div>

        {/* Table Section */}
        <div id="table-container">
          {error ? (
            <div className="error-message">{error}</div>
          ) : (
            <table>
              <thead>
                <tr>
                  <th onClick={() => handleSort("release_title")}>
                    Release Title {sortConfig.key === "release_title" ? (sortConfig.direction === "asc" ? "↑" : "↓") : ""}
                  </th>
                  <th onClick={() => handleSort("artist_count")}>
                    Number of Collaborators {sortConfig.key === "artist_count" ? (sortConfig.direction === "asc" ? "↑" : "↓") : ""}
                  </th>
                  <th onClick={() => handleSort("artist_names")}>
                    Artists {sortConfig.key === "artist_names" ? (sortConfig.direction === "asc" ? "↑" : "↓") : ""}
                  </th>
                </tr>
              </thead>
              <tbody>
                {filteredCollaborations.length > 0 ? (
                  filteredCollaborations.map((collab) => (
                    <tr key={collab.release_id}>
                      <td>{collab.release_title || "N/A"}</td>
                      <td>{collab.artist_count || "N/A"}</td>
                      <td>{collab.artist_names || "N/A"}</td>
                    </tr>
                  ))
                ) : (
                  <tr>
                    <td colSpan="3">No collaborations found matching the criteria.</td>
                  </tr>
                )}
              </tbody>
            </table>
          )}
        </div>
      </div>
    </>
  );
}
